import {SIGN_IN,SIGN_OUT} from './types';

export const signIn=(useremail)=>{

    return {
        type : SIGN_IN,
        payload :useremail
    }
}

export const signOut=()=>{

    return {
        type : SIGN_OUT
       
    }
}
